import React from "react";

import PlaceList from "../components/PlaceList";

const DUMMY_PLACES = [
    {
        id: 'p1',
        title: "simple building",
        description: 'sth for display',
        imageUrl: 'https://www.freepik.com/free-photo/beautiful-black-white-upshot-new-york-city-subway-s-wtc-cortlandt-station-k-oculus_7810347.htm#query=building&position=0&from_view=keyword',
        address: 'from google map',
        location: {
            lat: 40,
            lng: 50
        },
        creator: 'u1'
    },
    {
        id: 'p2',
        title: "simple building",
        description: 'sth for display',
        imageUrl: 'https://www.freepik.com/free-photo/beautiful-black-white-upshot-new-york-city-subway-s-wtc-cortlandt-station-k-oculus_7810347.htm#query=building&position=0&from_view=keyword',
        address: 'from google map',
        location: {
            lat: 40,
            lng: 50
        },
        creator: 'u2'
    }
]

const UserPlaces = () => {

    return <PlaceList items={DUMMY_PLACES} />;
};

export default UserPlaces;
